import '../styles/index.css';
function Hero(){
    return(
        <section className="hero">
        <div className="hero-swipe">
            <div className="hero-swipe-wrapper">
                <div className="hero-swipe-slide"></div>
            </div>
        </div>
    </section>
    );
}

export default Hero;
